import React from 'react';
import Header from './TreeVisualizer/Header'
import TreeVisualizer from './TreeVisualizer/TreeVisualizer';
//import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className="App">
      <Header />
      <TreeVisualizer />
    </div>
  );
}

export default App;
